- input: "TEXT\x1CC00188367\x1CTEXT-00001\x1C\x1CF3XA\x1CThe original Post-Election
    report included transfers from the ASDC Joint Victory Account. The ASDC Joint
    Victory Account committee has changed their name to DSP Joint Victory Fund. This
    report reflects that change. Two disbursements related to this account were unintentionally
    excluded from the original report as we misunderstood the statement from DSP Joint
    Victory Fund. Transfers to the Democratic Executive Committee of Florida and Pennsylvania
    Democratic Party are reflected on Schedule B, line 22. This report also reflects
    an in-kind contribution from AMERIPAC, dated 10/29/10. Advice of this contribution
    was not received until well after the Post-General filing deadline.  The receipts
    reported on Schedule A Line 15 from  Wyden for Senate, Future PAC, Senate Democratic
    Leadership Fund, Democratic National Committee, Friends of Tina Kotek and Friends
    of Chris Edwards are offsets for the payment of rent, telephone and copies. The
    Democratic Party of Oregon shares office space with several organizations. We
    write one check to pay rent. The amount of rent paid by each organization is assessed
    at the usual and normal charge, determinined by the amount of space occupied by
    the organization. Schedule A Line 15 reflects receipts from various County party
    and candidate committees. The Democratic Party of Oregon offers our County Committees
    and candidates  a number of technology services at cost.  These sevices include
    website and email services. Payments for salaries and wages reported on Schedule
    H4 are for employees who spent less than 25% of their time on FEA or activities
    in connection with a Federal election. Employees who spend more than 25% of their
    time on FEA or activities in connection with a Federal election are paid with
    100% Federal funds as are their fringe benefits and reported on Line 30b.  Some
    of the receipts disclosed on Line 17 are for the payment of Voter File access.
    The cost of this is determined by the size of list and this price properly reflects
    fair market value and the normal charge for similar lists in our state. All costs
    associated with the voter file are paid 100% out of the federal account.\n"
  record: fec.version.v6_4.TEXT
